var makeDom=require("../utils").makeDom,assert=require("assert");describe("helpers",function(){describe("removeSubsets",function(){var a=require("../..").removeSubsets,b=makeDom("<div><p><span></span></p><p></p></div>")[0];it("removes identical trees",function(){var c=a([b,b]);assert.equal(c.length,1)}),it("Removes subsets found first",function(){var c=a([b,b.children[0].children[0]]);assert.equal(c.length,1)}),it("Removes subsets found last",function(){var c=a([b.children[0],b]);assert.equal(c.length,1)}),it("Does not remove unique trees",function(){var c=a([b.children[0],b.children[1]]);assert.equal(c.length,2)})})});